import React from "react";
import ReactDOM from "react-dom";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";


const slideImages = [
  "https://static.filmnet.ir/images/94/51/94511e5d24fd4c799f94f16a83d1842f.jpg",
  "https://static.filmnet.ir/images/74/24/7424f63029db41bd9b35df817983c55e.jpg",
  "https://static.filmnet.ir/images/81/62/816279b8cbb54ba4b2911b7b59a2cd91.jpg",
];


class Slideshow extends React.Component {
  render() {
    var settings = {
      dots: true,
      speed: 500,
    };
    return (
      <div className="container">
        <Slider {...settings} >
          <div class="wrapper">
          </div>
          <div class="wrapper">
            <img src="https://static.filmnet.ir/images/74/24/7424f63029db41bd9b35df817983c55e.jpg?w=1500" alt="slide1"/>
          </div>
          <div class="wrapper">
            <img src="https://static.filmnet.ir/images/81/62/816279b8cbb54ba4b2911b7b59a2cd91.jpg?w=1500" alt="slide1"/>
          </div>
        </Slider>
      </div>
    );
  }
}

export default Slideshow;
